*/
pragma solidity 0.5.2;

import "openzeppelin-solidity/contracts/payment/escrow/RefundEscrow.sol";

contract FunderEscrowDetailed is RefundEscrow {
    uint256 public PLEDGE_AMOUNT;
    uint256 public INVESTOR_RETURN_ON_PLEDGE_AMOUNT_UPON_SALE;
    uint256 public GALLERY_FEE_UPON_SALE;
    uint256 public AEL_COMMISSION;
    uint256 public MAX_NUMBER_OF_PRINTS;
    uint256 public EXIT_CLAUSE_ADDITIONAL_PAYMENT_TO_BUY;
    uint256 public EXIT_CLAUSE_PAYOUT_FROM_AEL;
    uint256 public EXPIRATION_TIMESTAMP;

    address public AEL_GALLERY_ADDRESS;
    address public AEL_COMMISSION_ADDRESS;
    address public AEL_FUNDING_ADDRESS;

    address public THIRD_PARTY_GALLERY_ADDRESS;

    mapping(uint256 => address) public FIFOFunder;
    mapping(address => bool) public hasFunderBeenPaid;

    uint256 public funderIndex;
    uint256 public printSoldIndex;

    /**
   * @dev Constructor
   */
    constructor(
        address payable _beneficiary, uint256 _pledgeAmount, uint256 _investorReturnOnPledgeAmountUponSale,
        uint256 _galleryFeeUponSale, uint256 _commission, uint256 _maxNumberOfPrints,
        uint256 _exitClauseAddPayment, uint256 _exitClausePayoutFromAel, uint256 _expTimestamp,
        address _commissioningGalleryAddr, address _salesCommissionAddr, address _sellingGalleryAddr
    )
    public
    RefundEscrow(_beneficiary)
    {
        require(_pledgeAmount > 0, "in FunderEscrow:constructor(). Pledge amount must be greater than 0.");
        require(
            _investorReturnOnPledgeAmountUponSale > 0,
            "in FunderEscrow:constructor(). Return On Pledge Amount Upon Sale must be greater than 0."
        );
        require(_galleryFeeUponSale > 0, "in FunderEscrow:constructor(). Gallery fee must be greater than 0.");
        require(_commission > 0,
            "in FunderEscrow:constructor(). Return from sale proceeds must be greater than 0."
        );
        require(
            _maxNumberOfPrints > 0, "in FunderEscrow:constructor(). Max number of prints must be greater than 0."
        );
        require(_exitClauseAddPayment > 0,
            "in FunderEscrow:constructor(). Exit clause additional payment must be greater than 0."
        );
        require(_exitClausePayoutFromAel > 0,
            "in FunderEscrow:constructor(). Exit clause payout must be greater than 0."
        );
        require(_expTimestamp > block.timestamp,
            "in FunderEscrow:constructor(). Expiration timestamp is in the past."
        );

        require(_commissioningGalleryAddr != address (0),
            "in FunderEscrow:constructor(). Gallery address is zero address."
        );
        require(_salesCommissionAddr != address (0),
            "in FunderEscrow:constructor(). Sales commission address is zero address."
        );

        require(_sellingGalleryAddr != address (0),
            "in FunderEscrow:constructor(). Sales gallery address is zero address."
        );

        require(_beneficiary != address (0),
            "in FunderEscrow:constructor(). Beneficiary address is zero address."
        ); // Code coverage else path cannot be covered, Why? Have a look at CoverageReportReadme.md in the root dir

        PLEDGE_AMOUNT = _pledgeAmount;
        INVESTOR_RETURN_ON_PLEDGE_AMOUNT_UPON_SALE = _investorReturnOnPledgeAmountUponSale;
        GALLERY_FEE_UPON_SALE = _galleryFeeUponSale;
        AEL_COMMISSION = _commission;
        MAX_NUMBER_OF_PRINTS = _maxNumberOfPrints;
        EXIT_CLAUSE_ADDITIONAL_PAYMENT_TO_BUY = _exitClauseAddPayment;
        EXIT_CLAUSE_PAYOUT_FROM_AEL = _exitClausePayoutFromAel;
        EXPIRATION_TIMESTAMP = _expTimestamp;

        AEL_GALLERY_ADDRESS = _commissioningGalleryAddr;
        AEL_FUNDING_ADDRESS = _commissioningGalleryAddr;
        AEL_COMMISSION_ADDRESS = _salesCommissionAddr;

        THIRD_PARTY_GALLERY_ADDRESS = _sellingGalleryAddr;
    }
}
